import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import Loadable from 'react-loadable';
import { ErrorPage, Loading as Loader } from '../../errorPage/ErrorPage';
import { ajaxUtil, setHeaderUtil, saveCurrentStateUtil, setNotification, setModalPopupUtil, setLoadingUtil, isComplexTab } from '../Utils';
import { MESSAGE_UTILS } from '../../../util/Messages';
import { CONSTANTS, GLOBAL_CONSTANTS, SERVICE_BASE_APPROVALS } from '../../../util/Constants';
import { PRIVILIAGES as MENU_PRIVILIAGES } from '../../../util/Privilages';

const Loading = (props) => {
  if (props.isLoading) {
    if (props.timedOut) {
      return <ErrorPage errorCode={404} />;
    } else {
      return <Loader />;
    }
  } else if (props.error) {
    return <ErrorPage errorCode={500} />;
  } else {
    return <ErrorPage errorCode={404} />;
  }
}

function createLoadable(loader) {
  return Loadable({
    loader,
    loading: Loading
  });
}

const AsyncHome = createLoadable(() => import('../../kmsdashboard/DashBoard').catch(e => console.error(e)));

const AsyncChangePassword = Loadable({
  loader: () => import('../../changePswd/ChangePswd'),
  loading: Loading
});
const AsyncChangePin = Loadable({
  loader: () => import('../../changePin/changePin'),
  loading: Loading
});

const AsyncRoleCreate = Loadable({
  loader: () => import('../../role-management').then(module => module.CreateRole),
  loading: Loading
});
const AsyncRoleEdit = Loadable({
  loader: () => import('../../role-management').then(module => module.EditRole),
  loading: Loading
});
const AsyncRoleView = Loadable({
  loader: () => import('../../role-management').then(module => module.View),
  loading: Loading
});


const AsyncModuleCreate = Loadable({
  loader: () => import('../../module').then(module => module.CreateModule),
  loading: Loading
});
const AsyncModuleEdit = Loadable({
  loader: () => import('../../module').then(module => module.EditModule),
  loading: Loading
});
const AsyncModuleView = Loadable({
  loader: () => import('../../module').then(module => module),
  loading: Loading
});

const AsyncDashboardModule = createLoadable(() => import('../../kmsdashboard/Quiz').catch(e => console.error(e)));
// Mbooklet
const AsyncMBookLetModule = createLoadable(() => import('../../MBookLet').then(module => module.Dashboard).catch(e => console.error(e)));
const AsyncMBookLetParticipantModule = createLoadable(() => import('../../MBookLet').then(module => module.Participant).catch(e => console.error(e)));
// schedule
const AsyncTrainingMasterModule = createLoadable(() => import('../../schedule').then(module => module.TrainingMater).catch(e => console.error(e)));
const AsyncScheduleTrainingModule = createLoadable(() => import('../../schedule').then(module => module.ScheduleTraining).catch(e => console.log(e)));
const AsyncScheduleTrainingQuizModule = createLoadable(() => import('../../schedule').then(module => module.CreateQuiz).catch(e => console.log(e)));
const AsyncScheduleTrainingAccessOrderModule = createLoadable(() => import('../../schedule').then(module => module.AccessOrder).catch(e => console.log(e)));
const AsyncScheduleTrainingAddUserModule = createLoadable(() => import('../../schedule').then(module => module.AddParticipant).catch(e => console.log(e)));
const AsyncTrainingListModule = createLoadable(() => import('../../schedule').then(module => module.TrainingList).catch(e => console.log(e)));
const AsyncScheduleTrainingQuestionSetModule = createLoadable(() => import('../../schedule').then(module => module.QuestionSet).catch(e => console.log(e)));
const AsyncScheduleTrainingTrainingProgramModule = createLoadable(() => import('../../schedule').then(module => module.TrainingProgram).catch(e => console.log(e)));
const AsyncParticipantListModule = createLoadable(() => import('../../schedule').then(module => module.ParticipantList).catch(e => console.error(e)));

// reward
const RewardModule = createLoadable(() => import('../../reward').then(module => module.Reward).catch(e => console.error(e)));
// gamification
const GamifiacationConfigurationModule = createLoadable(() => import('../../gamification').then(module => module.ConfigurationList).catch(e => console.log(e)))
const GamifiacationScheduleModule = createLoadable(() => import('../../gamification').then(module => module.ScheduleList).catch(e => e.error(e)))

export const Routes = ({ userid, privilages, previousState, userChannelType, userEntityType, designationId, designation, loggedInUser, areaId, exportResponseHandler }) => {
  const properties = {
    'userId': userid,
    'entityId': userEntityType,
    'privilages': privilages,
    'ajaxUtil': ajaxUtil,
    'setHeader': setHeaderUtil,
    'saveCurrentState': saveCurrentStateUtil,
    'setNotification': setNotification,
    'setModalPopup': setModalPopupUtil,
    'loadingFunction': setLoadingUtil,
    'messagesUtil': MESSAGE_UTILS,
    'designationId': designationId,
    'designation': designation,
    'areaId': areaId,
    'globalConstants': GLOBAL_CONSTANTS,
    loggedInUser,
    exportResponseHandler
  }

  return (
    <div style={{ height: '100%' }}>
      <Switch>
        <Route exact path="/home" render={(props) => <AsyncHome {...props} {...properties}
          URLS={CONSTANTS.DASHBOARD} />}
        />

        <Route exact path="/changePswd" render={() => <AsyncChangePassword
          {...properties}
          urlConstants={CONSTANTS.CHANGE_PSWD}
          redirect="home"
        />} />

        <Route exact path="/changePin" render={() => <AsyncChangePin
          {...properties}
          urlConstants={CONSTANTS.CHANGE_PIN}
          redirect="home"
        />} />


        <Route exact path="/Roles/create" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.create)) ?
            <AsyncRoleCreate
              {...props}
              {...properties}
              url_Roles={CONSTANTS.ROLES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Roles/edit/:id" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.edit)) ?
            <AsyncRoleEdit
              {...props}
              {...properties}
              url_Roles={CONSTANTS.ROLES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Roles" render={() =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncRoleView
              {...properties}
              url_Roles={CONSTANTS.ROLES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
              previousState={previousState && previousState.obj.roles}
              previousStateKey="roles"
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />


        <Route exact path="/Modules/create" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.create)) ?
            <AsyncModuleCreate
              {...props}
              {...properties}
              url_Modules={CONSTANTS.MODULES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Modules/edit/:id" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.edit)) ?
            <AsyncModuleEdit
              {...props}
              {...properties}
              url_Modules={CONSTANTS.MODULES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Modules" render={() =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncModuleView
              {...properties}
              url_Modules={CONSTANTS.MODULES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Dashboard/Modules" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncDashboardModule
              {...props}
              {...properties}
              url_Modules={CONSTANTS.MODULES}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        {/* mbooklet routes */}

        <Route exact path="/Dashboard/MBookLet" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncMBookLetModule
              {...props}
              {...properties}
              url_Booklet={CONSTANTS.MBOOKLET}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/MBookLet/Participant/:id" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncMBookLetParticipantModule
              {...props}
              {...properties}
              url_Booklet={CONSTANTS.MBOOKLET}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        {/* training routes  */}
        <Route path="/Dashboard/Training/Master" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncTrainingMasterModule
              {...props}
              {...properties}
              url_training={CONSTANTS.TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Schedule/Training/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/Dashboard/Schedule/Training/QuestionSet/:schedule_id/:material_id/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingQuestionSetModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Schedule/Training/TrainingProgram/:schedule_id/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingTrainingProgramModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Schedule/Training/AccessOrder/:schedule_id/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingAccessOrderModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Schedule/Training/AddUser/:schedule_id/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingAddUserModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Schedule/Training/Quiz/:schedule_id/:edit?" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncScheduleTrainingQuizModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Training/List" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncTrainingListModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING_LIST}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />
        <Route exact path="/Dashboard/Training/ParticipantList/:name/:id" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <AsyncParticipantListModule
              {...props}
              {...properties}
              url_training={CONSTANTS.SCHEDULE_TRAINING_LIST}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        {/* reward routes */}
        <Route exact path="/home/reward/" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <RewardModule
              {...props}
              {...properties}
              url_reward={CONSTANTS.REWARD}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        {/* gamification routes */}
        <Route exact path="/gamification/configuration" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <GamifiacationConfigurationModule
              {...props}
              {...properties}
              url_game={CONSTANTS.GAMIFICATION}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route exact path="/gamification/schedule" render={(props) =>
          (properties.privilages.includes(MENU_PRIVILIAGES.ROLES.view)) ?
            <GamifiacationScheduleModule
              {...props}
              {...properties}
              url_game={CONSTANTS.GAMIFICATION}
              menuPrivilages={MENU_PRIVILIAGES.ROLES}
            /> : <Route path="/" render={() => <ErrorPage errorCode={404} />} />
        } />

        <Route path="/_refresh" render={() => <div className="p-5 text-center text-muted">Refreshing.....</div>} />

        <Route exact path="/" render={() => <Redirect to="/home" />} />
        <Route path="/" render={() => <ErrorPage errorCode={404} />} />

      </Switch>
    </div>
  )
}
